export default function Header() {

    return (
        <header class="page-header">
        <div class="header-logo">
            <h2>
                <a href="/" class="header-icon-link">Touken</a>
            </h2>
        </div>
        <div class="header-app-description">
            <span>home time</span>
        </div>
    </header>
    )

}
